        {
            placeSearchBox();
            PageMain.addResizeCallback(placeSearchBox);
        }
        
        // Pievienojam izsldo darbinieku rezulttu bloka przmanas izsaukumu uz lapas/loga izmra izmaim
        PageMain.addResizeCallback(initSidebarStyle);
        
